import React, { Component } from 'react'
import Pop from '../pages/pop'
import Pop_active from '../'

export class Exploits extends Component {
  render() {
    return (
      <div>
        <Pop_active />
        <Pop />
      </div>
    )
  }
}

export default Exploits
